import React from 'react';
import { url } from '../../../config';

const CategoryIcon = ({categoryIcon}) => {
    return (
        <div className='category-item-cube'>
            <img src={`${url}/uploads/category-icons/${categoryIcon}-active.png`} />
        </div>
    )
}

export default CategoryIcon;
